INSERT INTO `wp_my_calendar` (`event_id`, `event_begin`, `event_end`, `event_title`, `event_desc`, `event_short`, `event_registration`, `event_tickets`, `event_time`, `event_endtime`, `event_recur`, `event_repeats`, `event_status`, `event_author`, `event_host`, `event_category`, `event_link`, `event_post`, `event_link_expires`, `event_location`, `event_label`, `event_street`, `event_street2`, `event_city`, `event_state`, `event_postcode`, `event_region`, `event_country`, `event_url`, `event_longitude`, `event_latitude`, `event_zoom`, `event_phone`, `event_phone2`, `event_access`, `event_group_id`, `event_span`, `event_approved`, `event_flagged`, `event_hide_end`, `event_holiday`, `event_fifth_week`, `event_image`, `event_added`) VALUES
(1, '2023-04-11', '2023-04-11', 'Demo: Florence Price: Symphony No. 3 in c minor', '<p>Florence Price\'s <a href=\'https://en.wikipedia.org/wiki/Symphony_No._3_(Price)\'>Symphony No. 3</a> was commissioned by the Works Progress Administration\'s <a href=\'https://en.wikipedia.org/wiki/Federal_Music_Project\'>Federal Music Project</a> during the height of the Great Depression. It was first performed at the Detroit Institute of Arts on November 6, 1940, by the Detroit Civic Orchestra under the conductor Valter Poole.</p><p>The composition is Price\'s third symphony, following her Symphony in E minorthe first symphony by a black woman to be performed by a major American orchestraand her lost Symphony No. 2.</p>', 'Florence Price\'s Symphony No.3 was first performed on November 6th, 1940. It was Ms. Price\'s third symphony, following her lost Symphony No. 2', '', '', '19:30:00', '21:00:00', 'S1', '', 1, 1, 1, 1, 'https://www.youtube.com/watch?v=1jgJ1OkjnaI&list=OLAK5uy_lKldgbFTYBDa7WN6jf2ubB595wncDU7yc&index=2', 11, 0, 1, '', '', '', '', '', '', '', '', '', 0.000000, 0.000000, 16, '', '', '', 1, 0, 1, 0, 0, 0, 0, 'http://localhost/wp/wp-content/plugins/my-calendar/images/demo/event.jpg', '2023-04-10 09:29:31');
