(10, 11, '_mc_event_desc', '<p>Florence Price\'s <a href=\'https://en.wikipedia.org/wiki/Symphony_No._3_(Price)\'>Symphony No. 3</a> was commissioned by the Works Progress Administration\'s <a href=\'https://en.wikipedia.org/wiki/Federal_Music_Project\'>Federal Music Project</a> during the height of the Great Depression. It was first performed at the Detroit Institute of Arts on November 6, 1940, by the Detroit Civic Orchestra under the conductor Valter Poole.</p><p>The composition is Price\'s third symphony, following her Symphony in E minorthe first symphony by a black woman to be performed by a major American orchestraand her lost Symphony No. 2.</p>'),
