(11, 1, '2023-04-10 09:29:31', '2023-04-10 09:29:31', '<p>Florence Price\'s <a href=\'https://en.wikipedia.org/wiki/Symphony_No._3_(Price)\'>Symphony No. 3</a> was commissioned by the Works Progress Administration\'s <a href=\'https://en.wikipedia.org/wiki/Federal_Music_Project\'>Federal Music Project</a> during the height of the Great Depression. It was first performed at the Detroit Institute of Arts on November 6, 1940, by the Detroit Civic Orchestra under the conductor Valter Poole.</p><p>The composition is Price\'s third symphony, following her Symphony in E minorthe first symphony by a black woman to be performed by a major American orchestraand her lost Symphony No. 2.</p>', 'Demo: Florence Price: Symphony No. 3 in c minor', 'Florence Price\'s Symphony No.3 was first performed on November 6th, 1940. It was Ms. Price\'s third symphony, following her lost Symphony No. 2', 'publish', 'closed', 'closed', '', 'demo-florence-price-symphony-no-3-in-c-minor', '', '', '2023-04-10 09:29:31', '2023-04-10 09:29:31', '', 0, 'http://localhost/wp/mc-events/demo-florence-price-symphony-no-3-in-c-minor/', 0, 'mc-events', '', 0),
