title.elementor-size-xxl{font-size:59px}</style><h1>stories in photos</h1>		\n												<figure>\n										<img width=\"642\" height=\"737\" src=\"http://localhost/wp/wp-content/uploads/2023/04/Photographer-Image-1.jpg\" alt=\"\" loading=\"lazy\" srcset=\"http://localhost/wp/wp-content/uploads/2023/04/Photographer-Image-1.jpg 642w, http://localhost/wp/wp-content/uploads/2023/04/Photographer-Image-1-261x300.jpg 261w, http://localhost/wp/wp-content/uploads/2023/04/Photographer-Image-1-174x200.jpg 174w\" sizes=\"(max-width: 642px) 100vw, 642px\" />											<figcaption>01</figcaption>\n										</figure>\n			<p>Fruit & White</p>		\n												<figure>\n										<img width=\"642\" height=\"435\" src=\"http://localhost/wp/wp-content/uploads/2023/04/Photographer-Image-2.jpg\" alt=\"\" loading=\"lazy\" srcset=\"http://localhost/wp/wp-content/uploads/2023/04/Photographer-Image-2.jpg 642w, http://localhost/wp/wp-content/uploads/2023/04/Photographer-Image-2-300x203.jpg 300w, http://localhost/wp/wp-content/uploads/2023/04/Photographer-Image-2-200x136.jpg 200w\" sizes=\"(max-width: 642px) 100vw, 642px\" />											<figcaption>02</figcaption>\n										</figure>\n			<p>look of love</p>		\n												<figure>\n										<img width=\"424\" height=\"394\" src=\"http://localhost/wp/wp-content/uploads/2023/04/Photographer-Image-3.jpg\" alt=\"\" loading=\"lazy\" srcset=\"http://localhost/wp/wp-content/uploads/2023/04/Photographer-Image-3.jpg 424w, http://localhost/wp/wp-content/uploads/2023/04/Photographer-Image-3-300x279.jpg 300w, http://localhost/wp/wp-content/uploads/2023/04/Photographer-Image-3-200x186.jpg 200w\" sizes=\"(max-width: 424px) 100vw, 424px\" />											<figcaption>03</figcaption>\n										</figure>\n			<p>Light smile</p>		\n												<figure>\n										<img width=\"424\" height=\"394\" src=\"http://localhost/wp/wp-content/uploads/2023/04/Photographer-Image-4.jpg\" alt=\"\" loading=\"lazy\" srcset=\"http://localhost/wp/wp-content/uploads/2023/04/Photographer-Image-4.jpg 424w, http://localhost/wp/wp-content/uploads/2023/04/Photographer-Image-4-300x279.jpg 300w, http://localhost/wp/wp-content/uploads/2023/04/Photographer-Image-4-200x186.jpg 200w\" sizes=\"(max-width: 424px) 100vw, 424px\" />											<figcaption>04</figcaption>\n										</figure>\n			<p>Hiding Back</p>		\n												<figure>\n										<img width=\"424\" height=\"394\" src=\"http://localhost/wp/wp-content/uploads/2023/04/Photographer-Image-5.jpg\" alt=\"\" loading=\"lazy\" srcset=\"http://localhost/wp/wp-content/uploads/2023/04/Photographer-Image-5.jpg 424w, http://localhost/wp/wp-content/uploads/2023/04/Photographer-Image-5-300x279.jpg 300w, http://localhost/wp/wp-content/uploads/2023/04/Photographer-Image-5-200x186.jpg 200w\" sizes=\"(max-width: 424px) 100vw, 424px\" />											<figcaption>05</figcaption>\n										</figure>\n			<p>Hurting Eyes</p>		\n												<figure>\n										<img width=\"642\" height=\"435\" src=\"http://localhost/wp/wp-content/uploads/2023/04/Photographer-Image-6.jpg\" alt=\"\" loading=\"lazy\" srcset=\"http://localhost/wp/wp-content/uploads/2023/04/Photographer-Image-6.jpg 642w, http://localhost/wp/wp-content/uploads/2023/04/Photographer-Image-6-300x203.jpg 300w, http://localhost/wp/wp-content/uploads/2023/04/Photographer-Image-6-200x136.jpg 200w\" sizes=\"(max-width: 642px) 100vw, 642px\" />											<figcaption>06</figcaption>\n										</figure>\n			<p>blooming everything</p>		\n												<figure>\n										<img width=\"642\" height=\"737\" src=\"http://localhost/wp/wp-content/uploads/2023/04/Photographer-Image-7.jpg\" alt=\"\" loading=\"lazy\" srcset=\"http://localhost/wp/wp-content/uploads/2023/04/Photographer-Image-7.jpg 642w, http://localhost/wp/wp-content/uploads/2023/04/Photographer-Image-7-261x300.jpg 261w, http://localhost/wp/wp-content/uploads/2023/04/Photographer-Image-7-174x200.jpg 174w\" sizes=\"(max-width: 642px) 100vw, 642px\" />											<figcaption>07</figcaption>\n										</figure>\n	